PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "_prisma_migrations" (
    "id"                    TEXT PRIMARY KEY NOT NULL,
    "checksum"              TEXT NOT NULL,
    "finished_at"           DATETIME,
    "migration_name"        TEXT NOT NULL,
    "logs"                  TEXT,
    "rolled_back_at"        DATETIME,
    "started_at"            DATETIME NOT NULL DEFAULT current_timestamp,
    "applied_steps_count"   INTEGER UNSIGNED NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "Photo" (
    "id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    "naturalist_id" INTEGER NOT NULL,
    "url" TEXT NOT NULL,
    "birdId" INTEGER NOT NULL,
    CONSTRAINT "Photo_birdId_fkey" FOREIGN KEY ("birdId") REFERENCES "Bird" ("id") ON DELETE RESTRICT ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Order" (
    "id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    "name" TEXT NOT NULL
);
CREATE TABLE IF NOT EXISTS "Bird" (
    "id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    "name" TEXT NOT NULL,
    "naturalist_id" INTEGER NOT NULL,
    "category" TEXT,
    "orderId" INTEGER,
    CONSTRAINT "Bird_orderId_fkey" FOREIGN KEY ("orderId") REFERENCES "Order" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
PRAGMA writable_schema=ON;
CREATE TABLE IF NOT EXISTS sqlite_sequence(name,seq);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "Photo_naturalist_id_key" ON "Photo"("naturalist_id");
CREATE UNIQUE INDEX "Bird_name_key" ON "Bird"("name");
CREATE UNIQUE INDEX "Bird_naturalist_id_key" ON "Bird"("naturalist_id");
CREATE UNIQUE INDEX "Order_name_key" ON "Order"("name");
PRAGMA writable_schema=OFF;
COMMIT;
